import imagelogo from './imagelogo.png'

const App = function() {
  return ( 
    <div className="App"> 
      <Header />

      <div className="block">
      <nav className="nav">
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>Music</a></div>
        <div><a>Settings</a></div>
        HiperNav
      </nav>

      <main className="main">
        <div>
          <img src=""/>
        </div>
        <div>ava+description</div>
        <div>mi post</div>
        <div>new post</div>
        Main content
      </main>
      </div>
    </div> 
  );
}

export default App;
